import React from "react";
import "./Speaker.css";
import { BrowserRouter as Router, NavLink } from "react-router-dom";

import { motion } from "framer-motion";

import { SpeakerCard } from "./SpeakerCard"

export function SpeakerList({ data }) {
    return (
      <div className="speaker-list-container">
      <div className="spekaer-list-nav">
      <div>Week 1 Nov 23 - Nov 29</div>
      <div>Week 2 Dec 1 - Dec 6</div>
      </div>  

      <div className="speaker-list-left">
          {data
            .filter((x, i) => i % 2 === 0)
            .map((x, i) => {
              return (
                <NavLink to={`/${x.link}`} key={i}>
                  <SpeakerCard data={x} />
                </NavLink>
              );
            })}
        </div>
        <div className="speaker-list-right">
          {data
            .filter((x, i) => i % 2 === 1)
            .map((x, i) => {
              return (
                <NavLink to={`/${x.link}`} key={i}>
                  <SpeakerCard data={x} />
                </NavLink>
              );
            })}
        </div>
      </div>
    );
  }
